measurements.description:
One flower and one bud on one cut inflorescence;  
   dorsal sepal and synsepal cream, striped bright green; 
   petals cream, striped and flushed green basally, flushed light maroon distally, small dark maroon spots overall;
   pouch green, flushed and veined dark maroon; 
   staminode cream, veined green centrally, flushed maroon edge;
	substance moderate; texture matte; slight damage in transit.
